import '../pages.css'
import Header from "../components/header";
import { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const navigate = useNavigate();

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [expertise, setExpertise] = useState('');
  const [errorMessage, setError] = useState('');

  const data = {
    email: email, password: password, first_name: firstName,
    last_name: lastName, expertise: expertise
  }

  const handleSubmit = (e) =>{
    e.preventDefault();

    axios.post("http://127.0.0.1:1111/api/v1/register/", data).then(
      () => { navigate("login")

      }).catch((error) => {
        if (error.response){
          setError(error.response.data.message);
        }
        else if (error.request){
          setError("no error response recieved")
        }
        else{
          setError("something bad occured");
        }        
      });

      alert(errorMessage);
      console.log(errorMessage);
  }



  return (
    <>
      <Header />

      <div className="register-container">
        <h1 style={{ marginBottom: "20px" }}>Register</h1>
        <form onSubmit={handleSubmit} >
          <input onChange={(e) =>{setEmail(e.target.value)}} type="text" name="email" placeholder="email"></input> <br />
          <input onChange={(e) =>{setPassword(e.target.value)}} type="text" name="password" placeholder="password"></input><br />
          <input onChange={(e) =>{setFirstName(e.target.value)}} type="text" name="firstname" placeholder="first name"></input><br />
          <input onChange={(e) =>{setLastName(e.target.value)}} type="text" name="lastname" placeholder="last name"></input><br />
          <input onChange={(e) =>{setExpertise(e.target.value)}} type="text" name="expertise" placeholder="expertise"></input><br />
          <button className="register-button">Register</button>
        </form>
        <h3>Forgot password?</h3>
        <p>---or---</p>
        <h3>Log in</h3>
      </div>
    </>
  );
};

export default Register;
